import React from "react";

function DataTable({ rows, theme }) {
  return (
    <table
      style={{
        width: "100%",
        borderCollapse: "collapse",
        backgroundColor: theme.tableBackground,
        color: theme.text
      }}
    >
      <thead>
        <tr>
          <th style={{ padding: "8px", borderBottom: "1px solid #ddd" }}>Nome</th>
          <th style={{ padding: "8px", borderBottom: "1px solid #ddd" }}>Setor</th>
          <th style={{ padding: "8px", borderBottom: "1px solid #ddd" }}>Mês/Ano</th>
          <th style={{ padding: "8px", borderBottom: "1px solid #ddd" }}>Finalizados</th>
          <th style={{ padding: "8px", borderBottom: "1px solid #ddd" }}>Score</th>
        </tr>
      </thead>
      <tbody>
        {rows.map((item, idx) => (
          <tr key={idx}>
            <td style={{ padding: "8px", borderBottom: "1px solid #eee" }}>
              {item.Nome || "–"}
            </td>
            <td style={{ padding: "8px", borderBottom: "1px solid #eee" }}>
              {item.Setor || "–"}
            </td>
            <td style={{ padding: "8px", borderBottom: "1px solid #eee" }}>
              {item.Mês || "–"}
            </td>
            <td style={{ padding: "8px", borderBottom: "1px solid #eee" }}>
              {item.Finalizados || 0}
            </td>
            <td style={{ padding: "8px", borderBottom: "1px solid #eee" }}>
              {isNaN(item.Score) ? "–" : item.Score.toFixed(2)}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default DataTable;
